import Image1 from '../Images/SliderOne.jpg';
import Image2 from '../Images/Slider1.jpeg';
import Image3 from '../Images/Slider2.jpg';
import Image4 from '../Images/Slider3.jpeg';


const Images = [
    {
        image : Image1,
        imgAlt : "Image-1"
    },
    {
        image : Image2,
        imgAlt : 'Image-2'
    },
    {
        image : Image3,
        imgAlt : "Image-3"
    },
    {
        image : Image4,
        imgAlt : "Image-4"
    }
]
export default Images;
